import React from "react";
import "./style.css";

function Jumbotron() {
  return (
    <div className="parallax text-center" id="text-jumbo">
      {/* <h1>Lauren Hutchinson</h1> */}
      <h5>Web Developer</h5>
      <h5> & Fitness Trainer</h5>
    </div>
  );
}

export default Jumbotron;
